Amazing Spider-Man Presents - American Son 01-04 (2010, Minutemen-Megatonic)

Promotional info - &quot;Following immediately on the heels of &quot;24/7&quot;, Spider-Man's world has become more messed-up and stressful than ever and the fact that his biggest enemy is in charge of the world - and the Avengers - is only the icing on a really dangerous cake. Now faced with hard choices about family and friendship, Spider-Man knows exactly what he has to do to save the world - it's time to take down Norman Osborn! &quot;

This is all four issues of the reprint series, in nice scans thanks to Minutemen-Megatonic. Please seed, and enjoy.

